import { Button, Dialog, DialogContent, DialogContentText, DialogTitle, TextField, Typography, CardMedia, DialogActions } from "@mui/material";
import { Box } from "@mui/system";
import { useState } from "react";

export default function  CryptoBlock(props) {

  const [open, setOpen] = useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <>
      <Box sx={{display: 'flex', flexDirection: 'row'}}>
      <CardMedia
        component="img"
        height="50"
        width="50"
        image="#"
        alt={props.name}
      />
     <Typography> {props.name}</Typography>


     <Button onClick={handleClickOpen} >Buy</Button>


     <Dialog open={open} onClose={handleClose}>
        <DialogTitle>{props.name}</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            id="name"
            label="Email Address"
            type="email"
            fullWidth
            variant="standard"
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleClose}>Subscribe</Button>
        </DialogActions>
      </Dialog>
      </Box>
    </>
  )
};
